import "./Edit.css";
import "../NewInspiration/InspirationForm"
import InspirationForm from "../NewInspiration/InspirationForm";

function Edit(props){
    return (
        <div className="edit-popup">
            <InspirationForm></InspirationForm>
            <button type="button" onClick={function(){props.onPopupEditHandler(props.id)}}>Save</button>
            <button type="button" onClick={props.onCancelEditHandler}>Cancel</button>
        </div>
    )

}

export default Edit;
